import React from "react";
import "./styles.css";

// REACT-ICONS
import { IoIosGlobe } from "react-icons/io";

// IMAGENS
// logo da marca
import logocrypto from "../../Images/Navbar/crypt-logo-white.png";
// logo da google play
import googleplay from "../../Images/Navbar/play-store-button.png";
// logo da app store
import appstore from "../../Images/Navbar/app-store-button.png";



function Navbar() {
    return (
        <nav>
            <div>
                <div>
                    <a href="#">
                        <img src={logocrypto} />
                    </a>

                    <div>
                        <div>
                            <div>
                                <a href="https://crypto.com/nft/">NFT</a>
                                <span>NEW</span>
                            </div>
                            <div>
                                <span>Products</span>
                            </div>
                            <div>
                                <span>Company</span>
                            </div>
                            <a href="https://crypto.com/price">Prices</a>
                            <div>
                                <span>EN</span>
                            </div>
                            <div>
                                <IoIosGlobe />
                            </div>
                        </div> {/* div que comporta as li´s em formato de div´s */}
                        <div>
                            <div>
                                <a href="#">
                                    <img src={googleplay} width="44px" />
                                </a>
                            </div>
                            <div>
                                <a href="#">
                                    <img src={appstore} width="44px" />
                                </a>
                            </div>
                        </div> {/* comporta as div´s dos logos do google play e app store */}
                    </div> {/* essa div comporta os li´s e os botões do google play e app store */}
                </div> {/* essa div vai comportar os elementos linkáveis, tais como: logo e li´s */}
            </div> {/* essa div vai adicionar uma margem para os lados e centralizar verticalmente os elem */}
        </nav>
    )
}

export default Navbar
